const solution = require(".");

describe("B. Основание строки", () => {
    test("test-1", () => {
        const result = solution("zzz");
        expect(result).toEqual(1);
    });
    test("test-2", () => {
        const result = solution("bcabcab");
        expect(result).toEqual(3);
    });
    test("test-3", () => {
        const result = solution(
            "zbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzbzz"
        );
        expect(result).toEqual(113);
    });
    test("test-4", () => {
        const result = solution(
            ""
        );
        expect(result).toEqual(50000);
    });
});
